import React from "react";
import Variants from "./Variants";

const Vendor = ({ vendor }) => {
  console.log(vendor, "vendor component");
  return (
    <div className="vendor-detail">
      <Table>
        <thead>
          <tr>
            <th>Vendor Name</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td>{vendor?.name}</td>
          </tr>
        </tbody>
      </Table>
    </div>
  );
};

export default Vendor;
